import React from 'react';
import './SideBar.css';
import logo from '../imgs/logo.png'

const SideBar = () => {
  return (
    <div className="Sidebar">
        {/*logo*/}

        <div className="logo">
            <img src={logo} alt="" />
            <span>River's Edge</span>
        </div>

    </div>
  )
}

export default SideBar
